import './App.css';
import Greet from './Components/Headernav/greet';
import Welcome from './Components/Headernav/Welcome';
import HomeIcon from '@material-ui/icons/HomeTwoTone';
import { Switch } from '@material-ui/core'
import DatePickers from './Components/datepicker'
import PrimarySearchAppBar from './Components/Headernav/Nav_Bar'
import PersistentDrawerLeft from './Components/Headernav/side_navbar'
function App() {
  return (
    <div className="App">
      <PrimarySearchAppBar />
      <PersistentDrawerLeft />
      <Greet />
      <Welcome />
      <HomeIcon color="primary" size="large" />
      <Switch />
      <DatePickers />

    </div>
  );
}

export default App;
